    assertPermission((short)010660, filePath);

    aclSpec = Lists.newArrayList(
      aclEntry(ACCESS, USER, "bruce", READ));
    exception.expect(NSQuotaExceededException.class);
    hdfs.removeAcl(filePath);
  }

